import { Component } from '@angular/core';

@Component({
  selector: 'app-eventos',
  templateUrl: './eventos.component.html',
  styleUrls: ['./eventos.component.scss']
})
export class EventosComponent {

  public eventos: any = [
    {
      Tema: "Angular",
      Local: "Campo Grande"
    },
    {
      Tema: "Angular e Suas Novidades",
      Local: "São Paulo"
    },
    {
      Tema: "SQL Server ao vivo",
      Local: "Curitiba"
    }
  ]

}
<h1>Eventos do Componentes</h1>

<p><b>Tema: </b> {{eventos[0].Tema}}</p>
<p><Local: {{eventos[0].Local}}</p>

<p>{{eventos[1].Tema}}</p>
<p>{{eventos[1].Local}}</p>

<p>{{eventos[2].Tema}}</p>
